import React from 'react';
import { Container, Row, Col } from "react-bootstrap";
import Santeros1 from "../images/Santeros1.png"

var canario_passarinho = "https://www.recantocaipira.com.br/duplas/canario_passarinho/canario_passarinho.html";
var sertanejo = "https://en.wikipedia.org/wiki/Sertanejo_music";
const Texts = () => {
  return(
    <Container id="about">
      <h1>Los Santeros</h1>
      <Row className="show-grid">
      <Col xs={12} sm={6}>
          <img src={Santeros1} width="80%" alt="Santeros"/>
      </Col>
        <Col xs={12} sm={6}>
          <h5>
            <p>
            Born in Franca, a small city of shoemakers in Brazil, Pedro Bergamo
            is the youngest son of Pedro Bergamo from the second era Sertanejo duo <a
            className="text_link" href={canario_passarinho} target="_blank">
            "Canário e Passarinho"</a> & Los Santeros is a Latin Rock band based in Helsinki,
            headed by the Brazilian singer-songwriter Pedro Bergamo. Inspired by latin-american magical realism and ancient Finnish folklore,
            the band draws inspiration from 70’s progressive rock.
            </p>
            <p>Line-up:</p>
            <p>Pedro Bergamo - Acoustic Guitar & Vocals</p>
            <p>Satu Lankinen - Accordion & Vocals</p>
            <p>Rolando Camilo - Drums & Vocals</p>
            <p>Seppo Salmi - Electric Guitar</p>
          </h5>
        </Col>
      </Row>

    </Container>
    );
};

export default Texts;
